CREATE TABLE m_training_tree_progress_reward(
  card_master_id INTEGER NOT NULL,
  activate_num INTEGER NOT NULL,
  display_order INTEGER NOT NULL,
  content_type INTEGER NOT NULL,
  content_id INTEGER NOT NULL,
  content_amount INTEGER NOT NULL,
  PRIMARY KEY (card_master_id, activate_num, display_order),
  FOREIGN KEY (card_master_id) REFERENCES m_card(id)
);
